import React, {Component} from 'react'
import LoadingBrain from '../LoadingAnimation'
import Modal from 'react-modal'

class LoadingModal extends Component {
    render(){
        const modalStyle = {
            content : {
                margin : "auto",
                width : "55vh",
                height : "53vh",
                position : "absolute",
                borderRadius : "10px",
                overflow : "none",
                boxShadow : "0px 0px 20px",
                animation : "form-transition 3s"
              }
        }
        return (
            <div style={{display : "flex"}}>
                <Modal isOpen={true} ariaHideApp={false} className="formTransition" style={modalStyle} width={10}>
                    <LoadingBrain/>
                </Modal>
            </div>
        )
    }
}

export default LoadingModal
